const App = () => {
  return (
    <BrowserRouter>
      <Sidebar></Sidebar>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/cities" element={<City />} />
        <Route path="/zones" element={<Zone />} />
        <Route path="/about" element={<About/>}></Route>
      </Routes>

      <Sidebar></Sidebar>
        <Routes>
          <Route path="/" element={ <Home/> } exact></Route>
          <Route path="/cities" element={<City/>}></Route>
          <Route path="/about" element={<Zone/>}></Route>
        </Routes>
    </BrowserRouter>
  );
};

export default App;
